import React, {Component} from 'react'
import { API_BASE } from '../constants';
import { Rating, Image } from 'semantic-ui-react'


class Profile extends Component {

	componentDidMount() {
		console.log(this.props.user)
	}

	render() {
		const {username, plant_care_rating, avatar} = this.props.user
		return (
			<div className="ui container doubling stackable three column grid"><br /><br />
				<div className="ui divided items">
					<div className="item">
						<div className="ui avatar circular image">
							<Image src={avatar ? API_BASE+avatar.url : "oops" } size="medium"/>
						</div>
						<div className="content"><div className="header">{username}</div>
							<div className="meta"><span>Date</span><span>Category</span></div>
							<Rating maxRating={5} rating={plant_care_rating} icon='star' size='huge' />
						</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Profile
